function ExerciseCard( {exercise} ) {


    return (
        <li className="card">
            <h4>Name: {exercise.name}</h4>
            <img src={exercise.gifUrl} alt={exercise.name} />
            <p></p>
        </li>
    )
}


export default ExerciseCard;
